    false,nt"url": null,nt"notes": "This project is developing models to examine
    the ecological roles of bald eagles in the Puget Sound region. It is primarily being
    done by NMFS FTEs, in collaboration with scientists from the State of Washington
    and University of Washington. Trophic ecology of bald eagles will be described using
    ecosystem-scale food web models and bioenergetics models. Working models and scientific
    manuscripts will be the main products. The target audience is the Puget Sound Partnership,
    resource management agencies, and stakeholders in the Puget Sound area. This is
    an on-going, stand-alone project without a firm deadline.nnSpreadsheet.",nt"owner_org":
